import Layout from '../components/layout';
import { Paper } from '@material-ui/core';

export default function() {
  return (
    <React.Fragment>
      <Layout>
        <Paper elevation={1} className="button-container">
          Hi
        </Paper>
      </Layout>
      <style>{`
        .button-container {
          width: 400px;
          height:400px;
        }
        p {
          color: blue;
        }
      `}</style>
    </React.Fragment>
  );
}
